import '../App.css';
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import Base from '../components/Base';
// import Button from './components/Button';

const App = () => {
  return (
    <BrowserRouter>
      <div>
        <Routes>
          <Route path="/" exact={true}>
            <Base />
          </Route>
        </Routes>
      </div>
    </BrowserRouter>
  )
}

export default App;
